// Scope       : All Tags
// Execution   : Before Load Rules
// Condition   : n/a
// Description : Check if the user has just been added/removed from any audiences, populate those
//               values as strings into the UDO:
//                   - added_to_audiences
//                   - removed_from_audiences
//                   - current_audiences
//               String format is |102|103|104|, to allow 'contains' to be used in load rules. TiQ
//               will use toString() to check arrays, but that format (102,103,104) risks false  -
//               positives - 102 will return true if the user is in audience 1020). |102| is safer.

// for console testing, won't hurt anything
var b = b || utag.data;

// join an array into something like |102|103|104| from [102, 103, 104]
function convertArrayToString(arr, char) {
  char = char || &quot;|&quot;; // set default for optional arg
  return char + arr.join(char) + char;
}

// get a snapshot of the current audiences
var keys = Object.keys(b);
var re = /^va\.audiences.+/;
var currentAudiences = [];
var i;
for (i = 0; i &lt; keys.length; i++) {
  if (re.test(keys[i])) {
    // only take the audience number ('102' from 'va.audiences.1und1_main_102')
    currentAudiences.push(keys[i].split(&quot;_&quot;)[keys[i].split(&quot;_&quot;).length - 1]);
  }
}

// get the previously stored audiences from storage (if possible/populated)
var lastAudiences = [];
try {
  lastAudiences = JSON.parse(localStorage.getItem(&quot;tealium_last_audiences&quot;)) || [];
}
catch (err) {
  // no fallback, since DLE requires functioning localStorage
}

// get array of newly-added audiences
var addedAudiences = [];
for (i = 0; i &lt; currentAudiences.length; i++) {
  if (lastAudiences.indexOf(currentAudiences[i]) === -1) addedAudiences.push(currentAudiences[i]);
}

// get array of newly-removed audiences
var removedAudiences = [];
for (i = 0; i &lt; lastAudiences.length; i++) {
  if (currentAudiences.indexOf(lastAudiences[i]) === -1) removedAudiences.push(lastAudiences[i]);
}

// indicate the change and Audience states in the data layer (for FB, and any other tags)
b.removed_from_audiences = convertArrayToString(removedAudiences);
b.added_to_audiences = convertArrayToString(addedAudiences);
b.current_audiences = convertArrayToString(currentAudiences);

// overwrite the 'last_audiences' value with the current audiences, for use on next check
try {
  localStorage.setItem(&quot;tealium_last_audiences&quot;, JSON.stringify(currentAudiences));
}
catch (err) {
  // no fallback, since DLE requires functioning localStorage
}

