/**
 * Description: Helper code to store product specific information in an
 *  Array as needed for tealium default tags.
 * 
 * @storage: all Arrays are strored in the teal object.
 * @usage: Used in the datalayer helper to persist product information
 *  if multiple products are present on a page or for an interaction.
 *  @documentation: {{Confluence Link}}
 */
teal._dlHelper.createProductArray = function(message) {
    /**
     * Handles product mapping from datalayer to tealium structure containing arrays.
     *
     * Needs to be populated for all product specific datalayer variables. A list of 
     * all possible values can be found on the corresponding ecommerce variables wiki
     * page.
     * 
     * @status: currently implemented:
     * - product.id
     * - product.name
     * - product.category
     * - product.quantity
     */

    var possible_keys = this.product_keys;

    for (var item in possible_keys) {
        item = possible_keys[item];
        this[item] = this[item] || [];
        this[item].push(message[item] || ''); // push default value if not set
    }

    return;
};

teal._dlHelper.getProductArray = function(model) {
    /**
     * Replaces all product keys with array values
     * 
     * @status: currently implemented for all values in product_keys
     * @param: model to be passed to tealium
     * @return: model with updated product keys
     */

    var possible_keys = this.product_keys;

    for (var item in possible_keys) {
        item = possible_keys[item];
        model[item] = this[item];
    }

    return model;
};

teal._dlHelper.clearProductArray = function() {
    /**
     * Clears all Product Arrays after Tracking Request is sent.
     * 
     * @status: implementing
     */

    var possible_keys = this.product_keys;

    for (var item in possible_keys) {
        this[possible_keys[item]] = undefined;
    }

    return;
};

